import React from "react";

export default function RoomOne() {
  return (
    <div className="instructions-landing">
      <ReactPlayer
        className="react-player fixed-bottom"
        url={instructionsVideo}
        width="100%"
        height="100%"
        controls={false}
        loop={true}
        playing={true}
      />
      <Link to="/quiz" className="to-button-quiz">
        lets begin
      </Link>
    </div>
  );
}
